import styled from "styled-components";

export const Test = styled.div`
height: 200px;
width: 200px;
background-color: ${(props)=> props.backgroundColor};

&:hover{
    background-color: white;
}

`

export const TestText = styled.h1`
font-size: 25p;
color: white
`
